import 'bootstrap/dist/css/bootstrap.min.css';
import Feed from './Feed.js';
import Auth from './Auth.js';

import { Router, Routes, Route } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" Component={Feed}/>
          <Route path="/auth" Component={Auth}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
